import React from "react";

function Analytics() {
  return (
    <div>
      <p
        style={{
          color: "#5076FF",
          fontWeight: "600",
          fontSize: "2.5em",
          textAlign: "center",
          marginTop: "10vh",
        }}
      >
        Quiz Analysis
      </p>
      <p style={{height:"6vh",width:"60vw",marginLeft:"10vw",marginRight:"10vw"}}><span>S.No</span><span>Quiz Name </span><span>Created on</span><span>Impression</span></p>
    </div>
  );
}

export default Analytics;
